export const workflowRouter = router({
  // 1. GET ALL (With Lazy Seeding)
  getAll: protectedProcedure.query(async ({ ctx }) => {
    // A. Fetch existing workflows
    const workflows = await prisma.workflow.findMany({
      where: { 
        userId: ctx.userId // ðŸ‘ˆ Only fetch user's own workflows
      },
      orderBy: { updatedAt: "desc" },
    });

    // B. If user has NO workflows, create the default one automatically
    if (workflows.length === 0) {
      const newWorkflow = await prisma.workflow.create({
        data: {
          userId: ctx.userId,
          name: DEFAULT_WORKFLOW.name,
          nodes: DEFAULT_WORKFLOW.nodes,
          edges: DEFAULT_WORKFLOW.edges,
        }
      });
      // Return the newly created workflow as the only item in the list
      return [newWorkflow];
    }

    // C. Otherwise, return what they have
    return workflows;
  }),

  // 2. GET ONE (Scoped to User)
  getOne: protectedProcedure
    .input(z.object({ id: z.string() }))
    .query(async ({ ctx, input }) => {
      const workflow = await prisma.workflow.findFirst({
        where: { 
          id: input.id,
          userId: ctx.userId // ðŸ‘ˆ Ensure ownership
        },
      });

      if (!workflow) throw new TRPCError({ code: 'NOT_FOUND' });
      return workflow;
    }),

  // 3. SAVE (Create or Update with Ownership Check)
  save: protectedProcedure
    .input(
      z.object({
        id: z.string().optional(),
        name: z.string(),
        nodes: z.array(z.any()), 
        edges: z.array(z.any()),
      })
    )
    .mutation(async ({ ctx, input }) => {
      if (input.id) {
        // UPDATE existing
        // First verify ownership
        const existing = await prisma.workflow.findFirst({
            where: { id: input.id, userId: ctx.userId }
        });

        if (!existing) throw new TRPCError({ code: 'FORBIDDEN' });

        return await prisma.workflow.update({
          where: { id: input.id },
          data: {
            name: input.name,
            nodes: input.nodes, 
            edges: input.edges,
            updatedAt: new Date(), 
          },
        });
      } else {
        // CREATE new
        return await prisma.workflow.create({
          data: {
            userId: ctx.userId, // ðŸ‘ˆ Use authenticated User ID
            name: input.name,
            nodes: input.nodes ?? [],
            edges: input.edges ?? [],
            // createdAt & updatedAt handled by Prisma defaults
          },
        });
      }
    }),

  // 4. DELETE (Scoped to User)
  delete: protectedProcedure
    .input(z.object({ id: z.string() }))
    .mutation(async ({ ctx, input }) => {
      // Verify ownership before delete
      const existing = await prisma.workflow.findFirst({
        where: { id: input.id, userId: ctx.userId }
      });

      if (!existing) throw new TRPCError({ code: 'FORBIDDEN' });

      return await prisma.workflow.delete({
        where: { id: input.id },
      });
    }),
});